(7, 1, '2018-07-22 16:26:53', '2018-07-22 15:26:53', '[et_pb_section bb_built=\"1\"][et_pb_row][et_pb_column type=\"4_4\"][et_pb_text]\n\n<p>This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:</p><blockquote><p>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like piña coladas. (And gettin\' caught in the rain.)</p></blockquote><p>...or something like this:</p><blockquote><p>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Leicester City, XYZ employs over 2,000 people and does all kinds of awesome things for the Leicester community.</p></blockquote><p>As a new WordPress user, you should go to <a href=\"http://localhost/roywenman/roywenman/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!</p>\n\n[/et_pb_text][/et_pb_column][/et_pb_row][/et_pb_section]', 'Sample Page', '', 'inherit', 'closed', 'closed', '', '2-autosave-v1', '', '', '2018-07-22 16:26:53', '2018-07-22 15:26:53', '', 2, 'http://localhost/roywenman/roywenman/2018/07/22/2-autosave-v1/', 0, 'revision', '', 0),
